import { useState, useEffect } from 'react';
import Header from '../components/layout/Header';
import Sand from '../assets/vehicles/sandcrawler.png'
import Button from '../components/Button';
import CardCheckout from '../components/CardCheckout';
import PaymentType from '../components/PaymentType';
import SmallInput from '../components/SmallInput';
import Policy from '../components/Policy';
import EmailCheckbox from '../components/EmailCheckbox';
import TrustCheckout from '../components/TrustCheckout';
import LargeInput from '../components/LargeInput';

import store from '../Stores/storeVehicle';
import { observer } from 'mobx-react';

function Checkout() {

    const [vehicle, setVehicle] = useState(Object)
    const [paymentType, setPaymentType] = useState(String)

    useEffect(() => {
        setVehicle(store.loadVehicle())
    },[])

    return (
        <div>      
            <div className="flex flex-col 
                            justify-center 
                            items-center 
                            w-screen 
                            overflow-x-hidden 
                            pb-12
            ">
                <form>
                    <div className="space-y-8 
                                    mt-12
                    ">
                        <div className="space-y-8 
                                        md:space-x-8 
                                        md:flex 
                                        md:flex-row 
                                        md:items-center
                        ">
                            <div>
                                <div className="mt-6 
                                                w-full 
                                                flex 
                                                justify-center
                                ">
                                    <TrustCheckout />  
                                </div>
                                    <CardCheckout img={vehicle.img} 
                                                  alt={vehicle.name} 
                                                  price={vehicle.price} 
                                                  name={vehicle.name} 
                                                  company={vehicle.company} 
                                    />
                            </div>
                            <div className="space-y-8">
                                <div className="mt-6 
                                                w-full 
                                                flex 
                                                justify-center">
                                    <PaymentType />
                                </div>
                                    <LargeInput id={'1'}
                                                name={'ccNumber'}
                                                label={'Número do Cartão'}                
                                                typed={'number'}

                                    />
                                        <LargeInput id={'2'}
                                                    name={'ccName'}
                                                    label={'Nome Impresso'}                  
                                                    typed={'text'}

                                        />
                                <div className="w-80 flex justify-between">
                                    <SmallInput id={'3'}
                                                name={'cvv'}
                                                label={'CVV'}                  
                                                typed={'number'}

                                    />
                                        <SmallInput id={'4'}
                                                    name={'validade'}
                                                    label={'Validade'}                  
                                                    typed={'text'}

                                        />
                                </div>
                            </div>
                        </div>
                            <div className="text-2xl 
                                            w-80 
                                            md:w-full 
                                            text-center 
                                            text-green-500
                            ">
                                <h1>
                                Preencha seus dados para adquirir o seu veículo:
                                </h1>
                            </div>
                        <div className="space-y-8 
                                        md:space-y-0 
                                        md:space-x-8 
                                        md:flex 
                                        md:flex-row
                        ">
                            <div className="space-y-8">
                                <LargeInput id={'5'}
                                            name={'firstName'}
                                            label={'Nome'}                
                                            typed={'text'}

                                />
                                <LargeInput id={'6'}
                                            name={'secondName'}
                                            label={'Sobre Nome'}
                                            typed={'text'}

                                />
                                    <LargeInput id={'7'}
                                                name={'email'}
                                                label={'Email'}
                                                typed={'text'}

                                    />
                                <LargeInput id={'8'}
                                            name={'cpfCnpj'}
                                            label={'CPF/CNPJ'}
                                            typed={'text'}

                                />
                                <LargeInput id={'9'}
                                            name={'cep'}
                                            label={'CEP'}
                                            typed={'number'}

                                />
                            </div>
                                <div className="space-y-8">
                                    <LargeInput id={'10'}
                                                name={'endereco'}
                                                label={'Endereço'}
                                                typed={'text'}

                                    />
                                    <div className="w-80 flex justify-between">
                                        <SmallInput id={'11'}
                                                    name={'numero'}
                                                    label={'Número'}                  
                                                    typed={'number'}

                                        />
                                            <SmallInput id={'12'}
                                                        name={'complemento'}
                                                        label={'Complemento'}                  
                                                        typed={'text'}

                                            />
                                    </div>
                                        <LargeInput id={'13'}
                                                    name={'cidade'}
                                                    label={'Cidade'}
                                                    typed={'text'}

                                        />
                                    <LargeInput id={'14'}
                                                name={'bairro'}
                                                label={'Bairro'}
                                                typed={'text'}

                                    />
                                        <LargeInput id={'15'}
                                                    name={'estado'}
                                                    label={'Estado'}
                                                    typed={'text'}

                                        />
                                </div>
                        </div>
                        <div className="md:flex md:space-x-8">
                            <Policy />
                            <EmailCheckbox />
                        </div>
                        <div className="w-full 
                                        flex 
                                        justify-center"
                        >
                            <Button  txt={'COMPRAR'} />
                        </div>
                    </div>
                </form>
            </div>
        </div>
  );
}

export default observer(Checkout);
